import {Item} from "./Item";

export const ItemList = ({tasks,onAddTask}) => {
    return (
        <div className="item-list-container">
            {
                tasks.map((task) => {
                    return <Item task={task} onAddTask={onAddTask} />
                })
            }
        </div>
    );
}
